import React from 'react'
import { Route } from 'react-router-dom'
import { withRouter } from 'react-router-dom'
import { inject, observer } from 'mobx-react'

@withRouter
@inject(({ stores }) => stores)
@observer
class AuthenRoutes extends React.PureComponent {
  render() {
    const { key, route, globalState } = this.props
    const { component, ...routeProps } = route

    return (
      <Route
        key={key}
        {...routeProps}
        render={() => {
          const Component = React.lazy(() => import(`../../pages/dashboard/${component}`))
          return <Component globalState={globalState} myInfo={globalState.myInfo} />
        }}
      />
    )
  }
}

export default AuthenRoutes
